import React from 'react';
import { Col, Row } from 'react-bootstrap';

export default function TopInfo(props) {
  console.log('topinfo', props);
  return (
    <Col lg={{ span: 9, offset: 1 }}>
      <Row className="pb-3">
        <Col>
          <h5>Developer</h5>
          <p>this.props.game.developers[0].name</p>
        </Col>
        <Col>
          <h5>Publisher</h5>
          {/* <p>
                  {props.game !== undefined
                    ? props.game.publishers[0].name
                    : ''}
                </p> */}
        </Col>
        <Col>
          <h5>Available</h5>
          {/* <p>
                  {props.game !== undefined
                    ? props.game.released
                    : ''}
                </p> */}
        </Col>
      </Row>
      <Row>
        <Col>
          <h5>Metacritic</h5>
          {/* <p>
                  {props.game !== undefined
                    ? props.game.metacritic
                    : ''}
                </p> */}
        </Col>
        <Col>
          <h5>Rating</h5>
          {/* <p>
                  {props.game !== undefined
                    ? props.game.rating
                    : ''}
                </p> */}
        </Col>
        <Col>
          <h5>Platform</h5>
        </Col>
      </Row>
    </Col>
  );
}
